import {request} from "./request";

export function insertGood(data) {
    return request({
        url:'/saler/insertGood',
        method:'post',
        headers: {'content-type': 'application/json'},
        data: JSON.stringify(data)
    })
}

export function getGoodAll() {
    return request({
        url: `/salers/good/${page}`,
        method: 'get',
    })
}
